import React from 'react';

export default function SideMenu({ activeTab, setActiveTab }) {
  const tabs = [
    { id: 'chat', label: 'üí¨' },
    { id: 'inventory', label: 'üéí' },
    { id: 'task', label: 'üìù' }
  ];

  return (
    <div style={{ display: 'flex', backgroundColor: '#eee', borderBottom: '2px solid #ccc' }}>
      {tabs.map(tab => (
        <button
          key={tab.id}
          onClick={() => setActiveTab(tab.id)}
          style={{
            flex: 1,
            padding: '10px',
            background: activeTab === tab.id ? '#ddd' : 'transparent',
            border: 'none',
            borderBottom: activeTab === tab.id ? '2px solid black' : '2px solid transparent',
            fontSize: '20px',
            cursor: 'pointer'
          }}
        >
          {tab.label}
        </button>
      ))}
    </div>
  );
}
